import React, { Component } from "react";
import "./bloodbank.css";
import "~bootstrap4-card-tables/src/bootstrap4-card-tables";

class BloodbankABCard extends Component {
  render() {
    return (
      <div className="card">
        <div className="card-block">
        <td>FFP AB Rh P(0+): {this.props.ffp_ABpos}</td>
          <td>FFP AB Rh N(0-): {this.props.ffp_ABneg}</td>
          <td>PC AB Rh P(0+): {this.props.pc_ABpos}</td>
          <td>PC AB Rh N(0-): {this.props.pc_ABneg}</td>


        </div>

          
      </div>
    );
  }
}

export default BloodbankABCard;
